		document.addEventListener("wipoLanguageChange", function(e){
			// extract the language code (e.g “fr”) from the event details
			var language = e.detail.languageSelected;
			console.log("language=" + language);
			if (language == 'fr') {
				setLanguageFR();
			} else if (language == 'es') {
				setLanguageES();
			} else {
				setLanguageEN();
			}

 		});

div .designationCell {
	width: 100%;
	padding: 5px;
}

.designationCell input {
	cursor: pointer;
}

.cp-container {
	width: 100%;
	padding: .35em .625em .75em;
	column-count: 3;
}

.cp-group {
	width: 100%;
}

.b-edit-panel, .b-edit-panel__section-group {
	margin-top: 1px !important;
}

.b-view-panel__content .b-view-panel__slot {
	padding: 1px;
}

.b-button-count {
	color: #1a1a1a;
	padding: 0.75em 0.0625em .6875em;
	display: inline-block;
}

.ui-selectonemenu-list-item.ui-state-highlight {
	background-image: none !important;
}

.b-table-fees {
	border-right: none !important;
}

		    //<![CDATA[	
		    	function scroll2(elementId) {
					var tag = $('#'+elementId);
					var top = tag.offset().top - $('.b-navigation-floater').outerHeight();
    				if(window.frameElement) {
        				top = top + $(window.frameElement).offset().top;
        				$(window.frameElement).parents('html,body').animate({scrollTop: top},'slow');
    				}else {
       					$('html,body').animate({scrollTop: top},'slow');
   				 	}
				}
			 //]]>

